import React from 'react'
import CardMesure from './CardMesure'

class Mesures extends React.Component {
	state = {
		u2eff: 0,
		i1eff: 0,
		i2eff: 0,
		p1: 0,
		p2: 0,
		rendement: 0
	}

	//
	render() {
		return (
			<div className="fluid">
				<div className="row">
					<div className="col s12 m4">
						<CardMesure
							color={'#ffa000'}
							max={220}
							value={this.state.u2eff}
							label={'U2eff(V)'}
						/>
					</div>

					<div className="col  s12 m4">
						<CardMesure
							color={'#ffa000'}
							max={10}
							value={this.state.i1eff}
							label={'I1eff(A)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ffa000'}
							max={10}
							value={this.state.i2eff}
							label={'I2eff(A)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ff6f00'}
							max={2000}
							value={232}
							label={'P1(W)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ff6f00'}
							max={2000}
							value={1000}
							label={'P2(W)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ff6f00'}
							max={100}
							value={90}
							label={'Rendement(%)'}
						/>
					</div>
				</div>
			</div>
		)
	}
}

export default Mesures
